function pop_up_center(local,w,h,scrol)
{var instan=local.replace(/\./g,"");instan=instan.replace(/\?/g,"");instan=instan.replace(/\//g,"");instan=instan.replace(/=/g,"");instan=instan.replace(/;/g,"");instan=instan.replace(/:/g,"");instan=instan.replace(/-/g,"");var largura=screen.width;var altura=screen.height;var XX=(largura-w)/2;var YY=(altura-h)/2;var janela=window.open(local,'POP_UP'+instan,'width='+w+',height='+h+',left='+XX+',top='+YY+',scrollbars='+scrol+',status=no,resizable=yes, toolbar=no,directories=no,menubar=no');janela.focus();}